    Description:
      "This is a one-time clinic. This class is a progression from Advanced Beginner Green Ball, and for our tennis stars that are solidifying their rallying skills on both forehand and backhand sides. In order to enter this class, students must be able to rally with the coach a minimum of 15 times in a row, including at least 3 backhands. Being able to demonstrate ready position and proper technique in forehand and backhand preparation and follow-through is needed. This student should be starting to consider playing competitively in tournaments or match play. In addition to being able to drop and hit a tennis ball into an intended area, students should be able to cooperatively rally 8 balls in a row with a classmate. Lastly, students must be able to hit 4 out of 10 serves. Coaches will continue to work on bettering the student?s serve and providing guidance for technical corrections on all strokes. Students can expect drills, points, and exciting games. Students can only advance with instructor or manager approval. Students may only register for classes at their skill level, and NOT multiple classes at varying skill levels.",
